import React, { Component } from "react";
import { Link } from "react-router-dom";
import {
  Badge,
  BreadcrumbItem,
  Breadcrumb,
  Container,
  Sidebar
} from "reactstrap";
class Header extends Component {
  render() {
    return (
      <div class="ui inverted menu">
        <Link to="/" class="active red item">Iventory Web</Link>
        <Link to="/items" class="orange item">Items</Link>
        <Link to="/units" class="yellow item">Units</Link>
        <Link to="/transactions" class="olive item">Transactions</Link>
        <Link to="/stocks" class="green item">Stocks</Link>
      </div>
    );
  }
}

export default Header;
